
public class A1H31TRY 
{

	static void get(int a[])
	{
		for (int i = 0; i < a.length; i++) 
		{
			System.out.print(a[i]+" ");
		}
	}
	public static void main(String[] args) 
	{
		int[] a= {1,2,3,4,5};
		get(a);

	}

}

